import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <h1>My Todos</h1>
      <div className="card">
        <h2>Items</h2>
        <div className="actions">
          <button className='btn'>Delete</button>
        </div>
      </div>
    </div>
  );
}

export default App;
